import React from 'react';
import './App.css';
import Navbar from './components/Navbar.js';
import Diagram from './components/Diagram.js';
import Form from './components/Form.js';
import Footer from './components/Footer.js';

function App() {
  return (
    <div>
      <Navbar />
      <header className="masthead bg-primary text-black text-center ti-header">
      <div class="jumbotron jumbotron-fluid ti-header">
				<div class="container">
					<h1 class="display-4">YOU ALREADY DO ENOUGH.</h1>
					<p class="lead">Let us help you spread your mission.</p>
          <img src="/petslookingoveranedge.jpeg"></img>
        </div>
      </div>
      </header>
      <Diagram />
      <Form />
      <Footer />
    </div>
  );
}

export default App;
